import React from 'react';

function Favorite({ favorites }) {
  return (
    <div className="favorites" id="favorites">
      <h3>Избранное</h3>
      <ul>
        {favorites.length > 0 ? (
          favorites.map((item, index) => <li key={index}>{item}</li>)
        ) : (
          <p>Добавьте советы в избранное</p>
        )}
      </ul>
    </div>
  );
}

export default Favorite;
